section	.text

	global	_start

_start:

	call	dr_quine_01			; call dr_quine
	mov	rax, 60				; macOS exit syscall
	mov	rdi, 0				; exit status 0
	syscall

dr_quine_01:

	xor	r15, r15			; r12 = 0
	xor	r9, r9
	xor	rcx, rcx			; r12 = 0

	lea	r15, [rel prog]			; r12 = &prog
	mov	r13, [rel borders1]		;
	mov	r14, [rel borders2]		;

	.dr_start_loop:

		mov	dil, [r15 + rcx]	; read byte
		cmp	dil, 0			; compare byte and 0
		je	.done			; jmp to end loop
	
		cmp	r9, 0 			; if rcx < border1
		je	.print_char
		;cmp	rcx, r14		; if rcx < border2  
		;jl	.print_nbr
		;jmp	.print_char		; if rcx >= border2
		jmp	.print_nbr
		
	.print_char:
		cmp	rcx, r13
		je	.reprint
		push	rax			;
		push	rdx			;
		push	rsi			;
		push	rdi			;
		push	rcx			;
		call	ft_putchar		; print char 
		pop	rcx			;
		pop	rdi			;
		pop	rsi			;
		pop	rdx			;
		pop	rax			;
		jmp     .continue

	.print_nbr:
	
		push	rax			;
		push	rsi			;
		push	rdi			;
		push	rdx
		push	rcx
		call	ft_putnbr
		cmp	rcx, 4053
		je	.move
		mov	dil, 44
		call	ft_putchar
		mov	dil, 32
		call	ft_putchar
		.move:
		pop	rcx
		pop	rdx
		pop	rdi			;
		pop	rsi			;
		pop	rax			;
		jmp     .continue
		
		.reprint:
		mov	rcx,0; [rel borders1]
		;inc	rcx
		mov	r9, 1
		jmp	.dr_start_loop


	.continue:
	inc	rcx
	jmp	.dr_start_loop
	
	.done:
	mov	dil, 10
	call	ft_putchar
	mov	dil, 10
	call	ft_putchar
	ret


ft_putnbr:

	push	rbx
	push	rcx
	push	r10
	push	r11
	push	r12
	push	r13
	push	r14
	xor	r14, r14				; index
	xor	r12, r12
	xor	r10, r10				; hold sign 0 unsiged 1 signed nbr
	mov	ebx, 0xA				; hold divisor
	lea	r11, [rel tmp_nbr]			; point r11 to tmp_nbr
	

	mov	eax, edi
	cmp	eax, 0x0				; compare with zero 
	jge	.nbr_loop_start				; jump and handle negative
	cmp	eax, -2147483648
	je	.handle_min_int
	neg	eax
	mov	r10, 1
	jmp	.nbr_loop_start 	

	.handle_min_int:
	; Special case: -2147483648
	mov	r10, 1
 	; Build the string manually or use alternative approach
	; For simplicity, let's handle it specially:
	lea	rsi, [rel nbr]
	;mov	dword [rsi], "-2147483648"
	mov	dword [rsi], "-214"
	mov	dword [rsi+4], "7483"
	mov	dword [rsi+8], "648"
	mov	byte [rsi+11], 0  
	mov	rax, rsi
	jmp	.return	

	.nbr_loop_start:
		cdq
		div	ebx				; divide by 10
		add	dl, '0'				; convert number to ascii char
		mov	[r11 + r14], byte dl		; move reminder to rsi
		inc	r14				;
		cmp	eax, 0x0			; compare eax and 0
		je	.nbr_loop_end			; jump to nbr_end_loop
		
		jmp	.nbr_loop_start			; jump to nbr_loop_start
		
	.nbr_loop_end:
	lea	rsi , [rel nbr]
	cmp	r10, 1					; compare if signed
	jne	.nbr_flip_loop_start			; jump and add sign		
	mov	[r11 + r14], byte '-'			; add sign symbol
	inc	r14
	
	;flip string
	.nbr_flip_loop_start:
		cmp	r14, 0
		je	.nbr_flip_loop_end		; jump to end loop

		mov	r13b, byte [r11 + r14 - 1]	; copy byte
		mov	[rsi + r12], byte r13b		; past byte 
		inc	r12
		dec	r14

		jmp	.nbr_flip_loop_start		; jump to nbr filp loop

	.nbr_flip_loop_end:
	mov	[rsi + r12] , byte 0			; add nil 
	mov	rax, rsi				; point rax to nbr
	;print nbr
	push	r12
	xor	r12, r12

	.putstr_loop_start:			; strat of loop

		mov	dl, byte[rsi + r12]	; load the curr rdx
		cmp	dl, 0x0			; compare dl and 0
		je	.putstr_loop_end	; jump to the end of loop

		mov	dil, dl		; store dl byte as arg for putchar in rdi (dil)
		push	rdi
		push	rsi
		push	rdx
		push	rax
		call	ft_putchar		; sys call to _ft_putchar
		pop	rax
		pop	rdx
		pop	rsi
		pop	rdi

		inc	r12			; increament rbx

		jmp	.putstr_loop_start	; jump to loop start

	.putstr_loop_end:
	pop	r12

	.return:
	pop	r14
	pop	r13
	pop	r12
	pop	r11
	pop	r10
	pop	rcx
	pop	rbx
	ret						; return rax 


ft_putchar:

	mov	[rel charbuffer], dil		; store character
	mov	rax, 1				; syscall number for write on macOS
	mov	rdi, 1				; stdout
	lea	rsi, [rel charbuffer]		; buffer pointer
	mov	rdx, 1				; length

	syscall

	ret


